_testimonial_repeater_1_name','field_639787bf5e440'),(4229,2,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(4230,2,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(4231,2,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(4232,2,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(4233,2,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(4234,2,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(4235,2,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(4236,2,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(4237,2,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(4238,2,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(4239,2,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(4240,2,'_builder_5_testimonials_testimonial_repeater_3_content','field_