_content','field_639787aa5e43e'),(12061,283,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(12062,283,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(12063,283,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(12064,283,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(12065,283,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(12066,283,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(12067,283,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(12068,283,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(12069,283,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(12070,283,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(12071,283,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(12072,283,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(12073,283,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(12074,283,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(12075,283,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(12076,283,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(12077,283,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(12078,283,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(12079,283,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(12080,283,'_builder_5_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(12081,283,'builder_5_testimonials_testimonial_repeater_3_title','CLIENT'),(12082,283,'_builder_5_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(12083,283,'builder_5_testimonials_testimonial_repeater','4'),(12084,283,'_builder_5_testimonials_testimonial_repeater','field_639787975e43d'),(12085,283,'builder_5_testimonials',''),(12086,283,'_builder_5_testimonials','field_6397877a5e43c'),(12087,283,'builder_4_testimonials_content','<h2 class=\"h1\">TESTIMONIALS</h2>'),(12088,283,'_builder_4_testimonials_content','field_639790ce038d6'),(12089,283,'builder_4_testimonials_testimonial_repeater_0_content','Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad'),(12090,283,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(12091,283,'builder_4_testimonials_testimonial_repeater_0_headshot','171'),(12092,283,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(12093,283,'builder_4_testimonials_testimonial_repeater_0_name','MARLON SUTTON'),(12094,283,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(12095,283,'builder_4_testimonials_testimonial_repeater_0_title','PROPERTY OWNER'),(12096,283,'_builder_4_testim