ty. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.</span></div>\r\n<div class=\"hTt9T\"></div>\r\n</div>\r\n</div>\r\n<div class=\"GmO6pf\"></div>'),(12445,288,'_builder_5_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(12446,288,'builder_5_testimonials_testimonial_repeater_0_headshot','282'),(12447,288,'_builder_5_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(12448,288,'builder_5_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(12449,288,'_builder_5_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(12450,288,'builder_5_testimonials_testimonial_repeater_0_title','CLIENT'),(12451,288,'_builder_5_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(12452,288,'builder_5_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(12453,288,'_builder_5_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(12454,288,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(12455,288,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(12456,288,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(12457,288,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(12458,288,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(12459,288,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(12460,288,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(12461,288,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(12462,288,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(12463,288,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(12464,288,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(12465,288,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(12466,288,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(12467,288,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(12468,288,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(12469,288,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(12470,288,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(12471,288,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(12472,288,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(12473,288,'_builder_5_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(12474,288,'builder_5_testimonials_testimonial_repeater_3_title','CLIENT'),(12475,288,'_builder_5_testimonials_testimonial_repeater_3_ti