h pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(12829,289,'_builder_5_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(12830,289,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(12831,289,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(12832,289,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(12833,289,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(12834,289,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(12835,289,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(12836,289,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(12837,289,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(12838,289,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(12839,289,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(12840,289,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(12841,289,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(12842,289,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(12843,289,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(12844,289,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(12845,289,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(12846,289,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(12847,289,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(12848,289,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(12849,289,'_builder_5_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(12850,289,'builder_5_testimonials_testimonial_repeater_3_title','CLIENT'),(12851,289,'_builder_5_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(12852,289,'builder_5_testimonials_testimonial_repeater','4'),(12853,289,'_builder_5_testimonials_testimonial_repeater','field_639787975e43d'),(12854,289,'builder_5_testimonials',''),(12855,289,'_builder_5_testimonials','field_6397877a5e43c'),(12856,289,'builder_4_testimonials_content','<h2 class=\"h1\">TESTIMONIALS</h2>'),(12857,289,'_builder_4_testimonials_content','field_639790ce038d6'),(12858,289,'builder_4_testimonials_testimonial_repeater_0_content','Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad'),(12859,289,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(12860,289,'builder_4_testimonials_testimonial_repeater_0_headshot','171'),(12861,289,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(12862,289,'builder_4_testimonials_testimonial_repeater_0_name','MARLON SUTTON'),(12863,289,'_builder_4_testimonials_testimoni