charge a penny over what was quoted. Would highly recommend.</span></div>\r\n<div class=\"hTt9T\"></div>\r\n</div>\r\n</div>\r\n<div class=\"GmO6pf\"></div>'),(13197,290,'_builder_5_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(13198,290,'builder_5_testimonials_testimonial_repeater_0_headshot','282'),(13199,290,'_builder_5_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(13200,290,'builder_5_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(13201,290,'_builder_5_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(13202,290,'builder_5_testimonials_testimonial_repeater_0_title','CLIENT'),(13203,290,'_builder_5_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(13204,290,'builder_5_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(13205,290,'_builder_5_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(13206,290,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(13207,290,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(13208,290,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(13209,290,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(13210,290,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(13211,290,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(13212,290,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(13213,290,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(13214,290,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(13215,290,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(13216,290,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(13217,290,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(13218,290,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(13219,290,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(13220,290,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(13221,290,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(13222,290,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(13223,290,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(13224,290,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(13225,290,'_builder_5_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(13226,290,'builder_5_testimonials_testimonial_repeater_3_title','CLIENT'),(13227,290,'_builder_5_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(13228,290,'builder_5_testimonials_testimonial_repeater','4'),(13229,290,'_builder_