">\r\n<div>\r\n<div class=\"Jtu6Td\"><span tabindex=\"-1\" data-expandable-section=\"\">Great service, &amp; accommodating. We rented the Cadillac stretch for our girls birthday party. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.</span></div>\r\n<div class=\"hTt9T\"></div>\r\n</div>\r\n</div>\r\n<div class=\"GmO6pf\"></div>'),(14114,372,'_builder_5_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(14115,372,'builder_5_testimonials_testimonial_repeater_0_headshot','282'),(14116,372,'_builder_5_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(14117,372,'builder_5_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(14118,372,'_builder_5_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(14119,372,'builder_5_testimonials_testimonial_repeater_0_title','CLIENT'),(14120,372,'_builder_5_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(14121,372,'builder_5_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(14122,372,'_builder_5_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(14123,372,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(14124,372,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(14125,372,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(14126,372,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(14127,372,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(14128,372,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(14129,372,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(14130,372,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(14131,372,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(14132,372,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(14133,372,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(14134,372,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(14135,372,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(14136,372,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(14137,372,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(14138,372,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(14139,372,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(14140,372,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(14141,372,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(14142,372,'_builder_5_testimonials_testimo