ials_content',''),(15494,255,'_builder_4_testimonials_content','field_639790ce038d6'),(15495,255,'builder_4_testimonials_testimonial_repeater_0_content','Great service, &amp; accommodating. We rented the Cadillac stretch for our girls birthday party. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.'),(15496,255,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(15497,255,'builder_4_testimonials_testimonial_repeater_0_headshot','282'),(15498,255,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(15499,255,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(15500,255,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(15501,255,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(15502,255,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(15503,255,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(15504,255,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(15505,255,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(15506,255,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(15507,255,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(15508,255,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(15509,255,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(15510,255,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(15511,255,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(15512,255,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(15513,255,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(15514,255,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(15515,255,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(15516,255,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(15517,255,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(15518,255,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(15519,255,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(15520,255,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(15521,255,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(15522,255,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(15523,255,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(15524,255,'_builder_4_testimonials_testimonial_repeater_3_name','field_6