r what was quoted. Would highly recommend.'),(15684,413,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(15685,413,'builder_4_testimonials_testimonial_repeater_0_headshot','282'),(15686,413,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(15687,413,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(15688,413,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(15689,413,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(15690,413,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(15691,413,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(15692,413,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(15693,413,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(15694,413,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(15695,413,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(15696,413,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(15697,413,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(15698,413,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(15699,413,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(15700,413,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(15701,413,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(15702,413,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(15703,413,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(15704,413,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(15705,413,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(15706,413,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(15707,413,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(15708,413,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(15709,413,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(15710,413,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(15711,413,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(15712,413,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(15713,413,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(15714,413,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(15715,413,'builder_4_testimonials_testimonial_repeater','4'),(15716,413,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(15717,413,'builder_4_testimonials',''),(15718,413,'_b