 HOWARD'),(15876,416,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(15877,416,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(15878,416,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(15879,416,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(15880,416,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(15881,416,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(15882,416,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(15883,416,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(15884,416,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(15885,416,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(15886,416,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(15887,416,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(15888,416,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(15889,416,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(15890,416,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(15891,416,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(15892,416,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(15893,416,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(15894,416,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(15895,416,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(15896,416,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(15897,416,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(15898,416,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(15899,416,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(15900,416,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(15901,416,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(15902,416,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(15903,416,'builder_4_testimonials_testimonial_repeater','4'),(15904,416,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(15905,416,'builder_4_testimonials',''),(15906,416,'_builder_4_testimonials','field_6397877a5e43c'),(15907,255,'builder_5_layout','Testimonials'),(15908,255,'_builder_5_layout','field_63972e598fed4'),(15909,255,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(15910,255,'_builder_5_contact_content','field_63979647305d3'),(15911,255,'builder_5_conta