','282'),(16488,420,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(16489,420,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(16490,420,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(16491,420,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(16492,420,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(16493,420,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(16494,420,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(16495,420,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(16496,420,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(16497,420,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(16498,420,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(16499,420,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(16500,420,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(16501,420,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(16502,420,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(16503,420,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(16504,420,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(16505,420,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(16506,420,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(16507,420,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(16508,420,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(16509,420,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(16510,420,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(16511,420,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(16512,420,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(16513,420,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(16514,420,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(16515,420,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(16516,420,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(16517,420,'builder_4_testimonials_testimonial_repeater','4'),(16518,420,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(16519,420,'builder_4_testimonials',''),(16520,420,'_builder_4_testimonials','field_6397877a5e43c'),(16521,420,'builder_5_layout','Contact'),(16522,420,'_builder_5_layout','field_63972e598fed4'),(16523,420,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[