ld_639787b25e43f'),(16707,421,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(16708,421,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(16709,421,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(16710,421,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(16711,421,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(16712,421,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(16713,421,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(16714,421,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(16715,421,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(16716,421,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(16717,421,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(16718,421,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(16719,421,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(16720,421,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(16721,421,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(16722,421,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(16723,421,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(16724,421,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(16725,421,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(16726,421,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(16727,421,'builder_4_testimonials_testimonial_repeater','4'),(16728,421,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(16729,421,'builder_4_testimonials',''),(16730,421,'_builder_4_testimonials','field_6397877a5e43c'),(16731,421,'builder_5_layout','Contact'),(16732,421,'_builder_5_layout','field_63972e598fed4'),(16733,421,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(16734,421,'_builder_5_contact_content','field_63979647305d3'),(16735,421,'builder_5_contact',''),(16736,421,'_builder_5_contact','field_63979634305d1'),(16737,421,'builder_4_testimonials_classes',''),(16738,421,'_builder_4_testimonials_classes','field_63e55dad75223_field_63c58e1babc15'),(16739,421,'builder_4_testimonials_style',''),(16740,421,'_builder_4_testimonials_style','field_63e55dad75223_field_63c58e07abc14'),(16741,421,'builder_4_testimonials_id','testimonials'),(16742,421,'_builder_4_testimonials_id','field_63e55dad75223_field_63c58f5259e75'),(16743,421,'builder_4_testimonials_background_image',''),(16744,421,'_builder_4_testimonials_background_image','field_63e55dad75223_field_63d2dc265a061'),(16745,421,'builder_5_contact_classes',''),(16746,421,'_builder_5_contact_classes','field_63e55cad4c98a_field_63c58e1babc15'),(1