ontent','Great service, &amp; accommodating. We rented the Cadillac stretch for our girls birthday party. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.'),(16920,423,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(16921,423,'builder_4_testimonials_testimonial_repeater_0_headshot','282'),(16922,423,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(16923,423,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(16924,423,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(16925,423,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(16926,423,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(16927,423,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(16928,423,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(16929,423,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(16930,423,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(16931,423,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(16932,423,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(16933,423,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(16934,423,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(16935,423,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(16936,423,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(16937,423,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(16938,423,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(16939,423,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(16940,423,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(16941,423,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(16942,423,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(16943,423,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(16944,423,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(16945,423,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(16946,423,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(16947,423,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(16948,423,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(16949,423,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(16950,423,'_builder_4_testimonials_testimonial_repeate