as clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.'),(17142,424,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(17143,424,'builder_4_testimonials_testimonial_repeater_0_headshot','282'),(17144,424,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(17145,424,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(17146,424,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(17147,424,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(17148,424,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(17149,424,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(17150,424,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(17151,424,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(17152,424,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(17153,424,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(17154,424,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(17155,424,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(17156,424,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(17157,424,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(17158,424,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(17159,424,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(17160,424,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(17161,424,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(17162,424,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(17163,424,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(17164,424,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(17165,424,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(17166,424,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(17167,424,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(17168,424,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(17169,424,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(17170,424,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(17171,424,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(17172,424,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(17173,424,'builder_4_testimonials_testimonial_repeater','4'),(17174,424,'_b