17372,426,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(17373,426,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(17374,426,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(17375,426,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(17376,426,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(17377,426,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(17378,426,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(17379,426,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(17380,426,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(17381,426,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(17382,426,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(17383,426,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(17384,426,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(17385,426,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(17386,426,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(17387,426,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(17388,426,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(17389,426,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(17390,426,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(17391,426,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(17392,426,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(17393,426,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(17394,426,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(17395,426,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(17396,426,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(17397,426,'builder_4_testimonials_testimonial_repeater','4'),(17398,426,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(17399,426,'builder_4_testimonials',''),(17400,426,'_builder_4_testimonials','field_6397877a5e43c'),(17401,426,'builder_5_layout','Contact'),(17402,426,'_builder_5_layout','field_63972e598fed4'),(17403,426,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(17404,426,'_builder_5_contact_content','field_63979647305d3'),(17405,426,'builder_5_contact',''),(17406,426,'_builder_5_contact','field_63979634305d1'),(17407,426,'builder_4_testimonials_classes',''),(17408,426,'_builder_4_testimonials_classes','field_63e55dad75223_fi