,''),(18066,432,'_builder_4_testimonials_content','field_639790ce038d6'),(18067,432,'builder_4_testimonials_testimonial_repeater_0_content','Great service, &amp; accommodating. We rented the Cadillac stretch for our girls birthday party. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.'),(18068,432,'_builder_4_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(18069,432,'builder_4_testimonials_testimonial_repeater_0_headshot','282'),(18070,432,'_builder_4_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(18071,432,'builder_4_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(18072,432,'_builder_4_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(18073,432,'builder_4_testimonials_testimonial_repeater_0_title','CLIENT'),(18074,432,'_builder_4_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(18075,432,'builder_4_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(18076,432,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(18077,432,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(18078,432,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(18079,432,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(18080,432,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(18081,432,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(18082,432,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(18083,432,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(18084,432,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(18085,432,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(18086,432,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(18087,432,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(18088,432,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(18089,432,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(18090,432,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(18091,432,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(18092,432,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(18093,432,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(18094,432,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(18095,432,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(18096,432,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'