ng FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(18557,255,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(18558,255,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(18559,255,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(18560,255,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(18561,255,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(18562,255,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(18563,255,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(18564,255,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(18565,255,'_builder_5_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(18566,255,'builder_5_testimonials_testimonial_repeater_3_headshot','280'),(18567,255,'_builder_5_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(18568,255,'builder_5_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(18569,255,'_builder_5_testimon