r_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(18754,441,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(18755,441,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(18756,441,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(18757,441,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(18758,441,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(18759,441,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(18760,441,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(18761,441,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(18762,441,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(18763,441,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(18764,441,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(18765,441,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(18766,441,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(18767,441,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(18768,441,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(18769,441,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(18770,441,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(18771,441,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(18772,441,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(18773,441,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(18774,441,'builder_4_testimonials_testimonial_repeater','4'),(18775,441,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(18776,441,'builder_4_testimonials',''),(18777,441,'_builder_4_testimonials','field_6397877a5e43c'),(18778,441,'builder_5_layout','Testimonials'),(18779,441,'_builder_5_layout','field_63972e598fed4'),(18780,441,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(18781,441,'_builder_5_contact_content','field_63979647305d3'),(18782,441,'builder_5_contact',''),(18783,441,'_builder_5_contact','field_63979634305d1'),(18784,441,'builder_4_testimonials_classes',''),(18785,441,'_builder_4_testimonials_classes','field_63e55dad75223_field_63c58e1babc15'),(18786,441,'builder_4_testimonials_style',''),(18787,441,'_builder_4_testimonials_style','field_63e55dad75223_field_63c58e07abc14'),(18788,441,'builder_4_testimonials_id','testimonials'),(18789,441,'_builder_4_testimonials_id','field_63e55dad75223_field_63c58f5259e75'),(18790,441,'builder_4_testimonials_background_image',''),(18791,441,'_builder_4_testimonials_background_image','field_63e55dad75223_field_63d2dc265a061'),(18792,441,'builder_5_contact_classes',''),(18793,441,'_builder_5_con