973,441,'_builder_5_testimonials_style','field_63e55dad75223_field_63c58e07abc14'),(18974,441,'builder_5_testimonials_id','testimonials'),(18975,441,'_builder_5_testimonials_id','field_63e55dad75223_field_63c58f5259e75'),(18976,441,'builder_5_testimonials_background_image',''),(18977,441,'_builder_5_testimonials_background_image','field_63e55dad75223_field_63d2dc265a061'),(18978,441,'builder_5_testimonials_content',''),(18979,441,'_builder_5_testimonials_content','field_639790ce038d6'),(18980,441,'builder_5_testimonials_testimonial_repeater_0_content','Great service, &amp; accommodating. We rented the Cadillac stretch for our girls birthday party. It was clean and everything we expected. They picked up on time, very polite and professional and didn‚Äôt charge a penny over what was quoted. Would highly recommend.'),(18981,441,'_builder_5_testimonials_testimonial_repeater_0_content','field_639787aa5e43e'),(18982,441,'builder_5_testimonials_testimonial_repeater_0_headshot','282'),(18983,441,'_builder_5_testimonials_testimonial_repeater_0_headshot','field_639787b25e43f'),(18984,441,'builder_5_testimonials_testimonial_repeater_0_name','DYLAN HOWARD'),(18985,441,'_builder_5_testimonials_testimonial_repeater_0_name','field_639787bf5e440'),(18986,441,'builder_5_testimonials_testimonial_repeater_0_title','CLIENT'),(18987,441,'_builder_5_testimonials_testimonial_repeater_0_title','field_639787c55e441'),(18988,441,'builder_5_testimonials_testimonial_repeater_1_content','The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(18989,441,'_builder_5_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(18990,441,'builder_5_testimonials_testimonial_repeater_1_headshot',''),(18991,441,'_builder_5_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(18992,441,'builder_5_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(18993,441,'_builder_5_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(18994,441,'builder_5_testimonials_testimonial_repeater_1_title','CLIENT'),(18995,441,'_builder_5_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(18996,441,'builder_5_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(18997,441,'_builder_5_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(18998,441,'builder_5_testimonials_testimonial_repeater_2_headshot',''),(18999,441,'_builder_5_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(19000,441,'builder_5_testimonials_testimonial_repeater_2_name','ZK'),(19001,441,'_builder_5_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(19002,441,'builder_5_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(19003,441,'_builder_5_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(19004,441,'builder_5_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(190