'The driver was very polite and helpful, and drove safely. He arrived on time at both pickup points. The bus was very clean and comfortable. I highly recommend this limo company!'),(19191,443,'_builder_4_testimonials_testimonial_repeater_1_content','field_639787aa5e43e'),(19192,443,'builder_4_testimonials_testimonial_repeater_1_headshot',''),(19193,443,'_builder_4_testimonials_testimonial_repeater_1_headshot','field_639787b25e43f'),(19194,443,'builder_4_testimonials_testimonial_repeater_1_name','DIANE MARSTON'),(19195,443,'_builder_4_testimonials_testimonial_repeater_1_name','field_639787bf5e440'),(19196,443,'builder_4_testimonials_testimonial_repeater_1_title','CLIENT'),(19197,443,'_builder_4_testimonials_testimonial_repeater_1_title','field_639787c55e441'),(19198,443,'builder_4_testimonials_testimonial_repeater_2_content','Excellent service! It\'s my second time using FiveStar limo. I use limo companies quite often and they deserve the 5 star in my book. Driver was professional and on time just like my first time booking. Thank you Five Star Limo!'),(19199,443,'_builder_4_testimonials_testimonial_repeater_2_content','field_639787aa5e43e'),(19200,443,'builder_4_testimonials_testimonial_repeater_2_headshot',''),(19201,443,'_builder_4_testimonials_testimonial_repeater_2_headshot','field_639787b25e43f'),(19202,443,'builder_4_testimonials_testimonial_repeater_2_name','ZK'),(19203,443,'_builder_4_testimonials_testimonial_repeater_2_name','field_639787bf5e440'),(19204,443,'builder_4_testimonials_testimonial_repeater_2_title','LOCAL GUIDE - CLIENT'),(19205,443,'_builder_4_testimonials_testimonial_repeater_2_title','field_639787c55e441'),(19206,443,'builder_4_testimonials_testimonial_repeater_3_content','My daughter hired a party bus for a birthday celebration and was super happy with her experience. I made most of the arrangements and the owner was helpful and responsive in all my interactions with him. I made our payment thru Venmo, which made it extremely convenient. The driver - Anthony - was one of the big highlights. Very nice guy. Gave me confidence that my daughter and her friends would have a fun night and also be well, and responsibly, cared for. I had concerns about hiring a party bus, because of the amount of money I was spending and because I had no recommendations from anyone I knew. In the end, though, I was completely satisfied with how things turned out ... from start to finish. I would definitely work with - and recommend - A Five Star Limo in the future.'),(19207,443,'_builder_4_testimonials_testimonial_repeater_3_content','field_639787aa5e43e'),(19208,443,'builder_4_testimonials_testimonial_repeater_3_headshot','280'),(19209,443,'_builder_4_testimonials_testimonial_repeater_3_headshot','field_639787b25e43f'),(19210,443,'builder_4_testimonials_testimonial_repeater_3_name','MARK OSLAR'),(19211,443,'_builder_4_testimonials_testimonial_repeater_3_name','field_639787bf5e440'),(19212,443,'builder_4_testimonials_testimonial_repeater_3_title','CLIENT'),(19213,443,'_builder_4_testimonials_testimonial_repeater_3_title','field_639787c55e441'),(19214,443,'builder_4_testimonials_testimonial_repeater','4'),(19215,443,'_builder_4_testimonials_testimonial_repeater','field_639787975e43d'),(19216,443,'builder_4_testimonials',''),(19217,443,'_builder_4_testimonials','field_6397877a5e43c'),(19218,443,'builder_5_layout','Testimonials'),(19219,443,'_builder_5_layout','field_63972e598fed4'),(19220,443,'builder_5_contact_content','<h2>ENQUIRE</h2>\r\n[gravityform id=\"1\" title=\"false\" description=\"false\" ajax=\"true\"]'),(19221,443,'_builder_5_contact_content','field_63979647305d3'),(19222,443,'builder_5_contact',''),(19223,443,'_builder_5_contact','field_63979634305d1'),(19224,443,'builder_4_testimonials_classes',''),(19225,443,'_builder_4_testimonials_classes','field_63e55dad75223_field_63c58e1babc15'),(19226,443,'builder_4_testimonials_style',''),(19227,443,'_builder_4_testimonials_style','field_63e55dad75223_field_63c58e07abc14'